import React, { useEffect, useState } from 'react'

const Search = () => {
  const [data, setData] = useState([])
  const fetchURL = "http://api.icndb.com/"
  const getData = () =>
    fetch(`${fetchURL}jokes/random/5`)
      .then((res) => res.json())

  useEffect(() => {
    getData().then((data) => setData(data))
  }, []);


  return (
    <div>
      {data.map((item=><tr key={item}>{item}</tr>))}
      {console.log(data.value)}
    


    </div>

  );
}

export default Search;
